import './style.css'
import React from 'react'

export function NavLogin() {
    
    React.useEffect(() => {
        getUserDetails()
            .then(({ data }) => {
                setUser(data);
                console.log(data)
                setLoading(false);
            }).catch((err) => {
                console.error(err)
                window.location.href = `https://simplify-code.com/api/auth/discord`
            })
    }, [])

    return (
        <div>
            <button className="login">Test</button>
        </div>
    )

}
